import React from 'react';
import './LandingPage.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faPlane, faBed, faCar } from '@fortawesome/free-solid-svg-icons';

function LandingPage() {
  return (
    <div className="landing-page">
      <header className="header">
        <a href="/" className="logo-link">
          <div className="logo"><FontAwesomeIcon icon={faPlane} /> TravelMate</div>
        </a>
      </header>

      <section className="hero">
        <div className="hero-content">
          <h1>Explore the World with Us</h1>
          <p>Your adventure starts here. Book tours, reserve tickets, and explore local attractions.</p>
          <div className="cta-buttons">
            <a href="/tour-booking" className="btn btn-tour"><FontAwesomeIcon icon={faPlane} /> Book a Tour</a>
            <a href="/room-booking" className="btn btn-room"><FontAwesomeIcon icon={faBed} /> Book a Room</a>
            <a href="/ride-booking" className="btn btn-ride"><FontAwesomeIcon icon={faCar} /> Book a Ride</a>
          </div>
        </div>
      </section>
    </div>
  );
}

export default LandingPage;
